export function parseInteger(value: any, defaultValue?: number):number|null;
export function parseNumber(value: any, defaultValue?: number):number|null;
export function parseNumberRange(value: any, defaultValue: number|null, min: number, max: number):number|null;
export function parseBoolean(value: any, defaultValue: boolean):boolean;
export function parseEnumValue<T>(value: any, enumObject: { [i: string]: T }, defaultValue?: T):T|null;
export function parseEnumKey<T>(value: any, enumObject: { [i: string]: T }, defaultValue?: T):T|null;

